import React from 'react'
import Garena from '../../img/GARENA BATTLE.png';
import skills from '../../img/5skills.jpg';
import greetings from '../../img/greetings.jpg';
import international from '../../img/International Friendship Day.jpeg';
import kargil from '../../img/Kargil Vijay Diwas.jpeg';
import parents from '../../img/National__Parents__Day.jpg';
import nelson from '../../img/Nelson_M._International_day.png';
import nature from '../../img/World Nature Conservation Day.jpeg';
import webd from '../../img/Web__development.jpg';
import {motion} from "framer-motion";
import './Works.css';

const Works = () => {
  const transition = {duration : 2, type : 'fade-in'}; 

  return (
    <div className="w-intro">
    <div className="w-left">
            <img src={Garena} alt="" />
            <img src={skills} alt="" />
            <img src={greetings} alt="" />
            <img src={international} alt="" />
            <img src={kargil} alt="" />
    </div>

    <div className="w-right">
      <motion.img initial={{left:"-36%"}} whileInView={{left: "-24%"}} transition={transition} src={parents} alt="" />
      <motion.img initial={{left:"-20%"}} whileInView={{left: "-12%"}} transition={transition} src={nelson} alt="" />
      <motion.img initial={{left:"58%"}} whileInView={{left: "50%"}} transition={transition} src={nature} alt="" />
      <motion.img initial={{left:"-30%"}} whileInView={{left: "-24%"}} transition={transition} src={webd} alt="" />
    </div>
  </div>
  )
}

export default Works;







